import React from 'react';
import axios from 'axios'
import Card from '../../components/Card';


const Catalog = ({items}) => {
   
   
    const renderItems = () => {
        const filteredItems = items.date
        // console.log(filteredItems)
        return( filteredItems.map((item,index)=>{
            <Card 
                key={index}
                {...item}
            />
        })
            
        )
        
    }

    return ( 
        <div>
            Каталог продуктов
            {
                renderItems()
            }
        </div>
     );
}
 
export default Catalog;
